INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div class="pull-left" id="jumbotron-text"><p>We are property clearance specialists operating in London, Surrey and the South East of England.</p></div>\r\n<div class="pull-right" id="jumbotron-button"><p><a href="/quote" class="btn btn-success btn-lg" role="button">Get a quote</a></p></div>', 'test feature block', 'full_html'),
(2, '<div class="row">\r\n<div class="col-xs-12 col-md-4">\r\n<p class="text-primary lead"><i class="fa fa-envelope"></i> <a href="mailto:info@lavenderclearances.com">info@lavenderclearances.com</a></strong></p>\r\n</div>\r\n<div class="col-xs-12 col-md-4">\r\n<p class="text-primary lead text-center"><i class="fa fa-phone"></i> <span class="rTapNumber30524">0208 286 3565</span></p>\r\n</div>\r\n<div class="col-xs-12 col-md-4">\r\n<p class="text-primary lead contact-bar-right"><i class="fa fa-twitter"></i> <a href="http://www.twitter.com/lavenderclearances">@LClearances</a></p>\r\n</div>\r\n</div>', 'Contact Header Strip', 'full_html'),
(4, '<p class="text-center">Like many of our clients, we are highly conscious of our responsibility to reduce waste and preserve resources. Recycling is a priority to us, and these are some of the steps we take to make sure our clearances are green and environmentally friendly.</p>\r\n<p class="text-center">We transport all waste to responsible recycling facilities.</p>', 'Home Recycle', 'full_html'),
(5, '<p class="text-center">10 years experience in Professional Clearance</p>', 'accolade', 'full_html'),
(6, '<img src="/sites/all/themes/lavender/images/creditcards.png" alt="We accept all major credit cards"><a href="/quote" class="btn btn-success btn-lg" role="button">Get a quote</a>', 'Tp quote button', 'full_html'),
(7, '<p class="text-center">Surrey, East Sussex, West Sussex, Kent, Hampshire, Essex</p>\r\n<div class="col-xs-12"><img src="sites/all/themes/lavender/images/about_us_map.jpg" class="img-responsive"/></div>', 'about areas', 'full_html'),
(8, '<img src="sites/all/themes/lavender/images/lav_contact_us.jpg" class="img-responsive"/>', 'Contact Map', 'full_html'),
(9, '<div class="col-xs-6 col-sm-2 footer-logo">\r\n<a href="http://www.environment-agency.gov.uk"><img src="/sites/all/themes/lavender/images/footer-images/enviromental_agency.jpg" alt="House Clearances Environment Agency" class="img-responsive"/></a>\r\n</div>\r\n<div class="col-xs-6 col-sm-2 footer-logo">\r\n<a href="http://www.macmillan.org.uk"><img src="/sites/all/themes/lavender/images/footer-images/macmillan.jpg" alt="Macmillan" class="img-responsive"/>\r\n</div>\r\n<div class="col-xs-6 col-sm-2 footer-logo">\r\n<a href="http://www.thechildrenstrust.org.uk"><img src="/sites/all/themes/lavender/images/footer-images/childrenstrust.jpg" alt="The Children''s Trust Tadworth" class="img-responsive"/>\r\n</div>\r\n<div class="col-xs-6 col-sm-2 footer-logo">\r\n<a href="http://www.cats.org.uk/"><img src="/sites/all/themes/lavender/images/footer-images/cats.jpg" alt="Cats Protection" class="img-responsive"/></a>\r\n</div>\r\n<div class="col-xs-6 col-sm-4 footer-logo">\r\n<a href="http://www.checkatrade.com/LavenderClearances/"><img src="/sites/all/themes/lavender/images/footer-images/checkatrade.jpg" alt="House Clearances Check a Trade"/></a>\r\n</div>', 'footer logos', 'full_html'),
(10, '<div class="col-xs-6 col-sm-3">\r\n<ul>\r\n<li><a href="/residential">Residential</a></li>\r\n<li><a href="/commercial">Commercial</a></li>\r\n<li><a href="/process">Our Process</a></li>\r\n<li><a href="/gallery">Gallery</a></li>\r\n<li><a href="/about-lavender-clearances">About Us</a></li>\r\n<li><a href="/testimonials">Testimonials</a></li>\r\n<li><a href="/blog">Blog</a></li>\r\n<li><a href="/sitemap">Sitemap</a></li>\r\n<li><a href="/privacy-policy">Privacy Policy</a></li>\r\n</ul>\r\n</div>\r\n<div class="col-xs-6 col-sm-3">\r\n<h3>Our Head Office</h3>\r\n<address>\r\n<strong>Lavender Clearances Ltd</strong>\r\n16 Cheam Common Road \r\nWorcester Park \r\nSurrey\r\nKT4 8RW\r\n</address>\r\n<ul>\r\n<li><a href="/contact-us">Contact Us</a></li>\r\n<li><strong>VAT Registration No.</strong> 177400020</li>\r\n</ul>\r\n</div>\r\n<div class="col-xs-11 col-sm-6">\r\n<ul id="footer-contact">\r\n<li><a href="mailto:info@lavenderclearances.com"><i class="fa fa-envelope"></i> info@lavenderclearances.com</a></li>\r\n<li><i class="fa fa-phone"></i> <span class="rTapNumber30524">0208 286 3565</span> (local rate)</li>\r\n<li><a href="https://www.facebook.com/LavenderClearances?ref=ts&fref=ts"><i class="fa fa-facebook-square"></i> facebook.com/lavenderclearances</a></li>\r\n<li><a href="https://twitter.com/LClearances"><i class="fa fa-twitter-square"></i> @LClearances</a></li>\r\n<li><a href="https://plus.google.com/111984323043542334056"><i class="fa fa-google-plus-square"></i> Google + Circles</a></li>\r\n</ul>\r\n</div>', 'Footer Content', 'full_html'),
