INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'webform', 0, 2, 2, 'und', 0, 'We are here to help 24/7 whenever you need our services. Simply call us, email us or fill out the form below to solve all your clearance problems. There is absolutely no obligation, and we think you will be pleasantly surprised with our prices! We look forward to hearing from you!', '', 'filtered_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<h2>10 Years Experience in Property Clearance</h2>\r\n<p class="text-center">We are London and the South Easts leading property clearance company. We specialise in house clearance.\r\nWe remove everything from furniture and white goods such as washing machines and cookers to carpets and soft furnishings. We also provide loft and garage clearances and garden clearance. Items can be cleared and delivered to an alternative address, stored or disposed of.</p>\r\n<p class="text-center">We take time wherever possible to recycle any items we may find, including clothes, books and paperwork.</p>\r\n<p class="text-center"><a href="residential" class="btn btn-primary btn-bd" role="button" title="Lavender Clearances - Commercial Clearances">Domestic Clearances</a></p>\r\n<h2>Commercial Clearance</h2>\r\n<p class="text-center">We also provide a range of commercial clearance services including waste removal and disposal, and office clearance. We can clear unwanted junk, clutter and rubbish as and when requested. Our office clearance in London, Surrey and the Home Counties, includes removal and disposal of office furniture, filing cabinets and paperwork, electrical appliances and computer parts. In London, Surrey and the Home Counties, we clear everything including carpets, scrap metal, heavy machinery, junk and verminous rubbish.</p>\r\n<p class="text-center"><a href="commercial" class="btn btn-primary btn-bd" role="button" title="Lavender Clearances - Commercial Clearances">Commercial Clearances</a></p>', '', 'full_html'),
('node', 'homepage_services', 0, 16, 16, 'und', 0, 'We can clear garden waste from gardens of all sizes.', '', 'filtered_html'),
('node', 'homepage_recycling_icons', 0, 17, 17, 'und', 0, 'Items that can be re-used are taken to businesses and charities, to be used as second-hand goods.', '', 'full_html'),
('node', 'homepage_services', 0, 20, 20, 'und', 0, 'We carry out trade clearance to the highest possible standard. ', '', 'plain_text'),
('node', 'homepage_recycling_icons', 0, 23, 23, 'und', 0, 'We recycle books, clothes and appliances. Unusable wooden furniture is shredded and used as wood chip - found in gardens and childrens playgrounds.', '', 'full_html'),
('node', 'homepage_services', 0, 27, 27, 'und', 0, 'For big or small properties, we carry out clearances professionally and quickly.', '', 'full_html'),
('node', 'homepage_services', 0, 28, 28, 'und', 0, 'Items that are big, bulky, and hard to move? Leave it to us.', '', 'plain_text'),
('node', 'homepage_recycling_icons', 0, 29, 29, 'und', 0, 'We try to give items a new home by passing them on to a wide range of businesses.', '', 'plain_text'),
('node', 'homepage_services', 0, 30, 30, 'und', 0, 'We do house contents valuations.\r\n\r\n', '', 'full_html'),
('node', 'address', 0, 31, 31, 'und', 0, 'Lavender Clearances Ltd \r\n16 Cheam Common Road \r\nWorcester Park \r\nSurrey\r\nKT4 8RW', '', 'filtered_html'),
('node', 'homepage_services', 0, 36, 36, 'und', 0, 'Were happy to clear even small items and knick-knacks.', '', 'plain_text'),
('node', 'homepage_services', 0, 40, 40, 'und', 0, 'We do full building site clearance, leaving spotless conditions.', '', 'filtered_html'),
('node', 'address', 0, 41, 41, 'und', 0, 'Address 1\r\nAddress 2\r\nTown\r\nCounty\r\nPostcode\r\n', '', 'plain_text'),
('node', 'homepage_services', 0, 43, 43, 'und', 0, 'Well clear out, and get rid of old, unwanted bits and pieces from your garage.', '', 'filtered_html'),
('node', 'address', 0, 44, 44, 'und', 0, 'Address 1\r\nAddress 2\r\nTown\r\nCounty\r\nPostcode', '', 'filtered_html'),
('node', 'address', 0, 45, 45, 'und', 0, 'Address 1\r\nAddress 2\r\nTown\r\nCounty\r\nPostcode', '', 'plain_text'),
('node', 'homepage_services', 0, 46, 46, 'und', 0, 'Well move heavy, bulky equipment, work stations, paperwork and more.', '', 'plain_text'),
('node', 'page', 0, 62, 62, 'und', 0, '<p class="text-center">Lavender Clearances are an experienced team of hard-working professionals who have been in the business for many years and understand the importance of high quality customer services and getting the job done right first time, every time.</p>\r\n<p class="text-center">We carry out all clearance work with professional diligence and the minimum of fuss.</p>\r\n', '', 'full_html'),
('node', 'services', 0, 69, 69, 'und', 0, 'Clearing a house can be a a big task which can be time consuming, complex and very physically demanding. Circumstances aren''t always pleasant either if it involves illness or bereavement. \r\n\r\nAt Lavender Clearances our aim is to make the process as quick and easy as possible. We are happy to undertake any house clearance task big or small, if it is the entire contents of a property, or even just a couple of items we will carry out the work efficiently and with professional diligence. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 70, 70, 'und', 0, 'We don''t just clear buildings, our services also extend to your gardens, no matter the size! So if you''ve been carrying out work in your garden and have been left with more garden waste than you can comfortably handle yourself then give us a call and we will get to work clearing your garden waste.\r\n\r\nRegardless of the size we will carry out garden clearances with professional diligence and the minimum of fuss. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 71, 71, 'und', 0, 'One of our many services at Lavender Clearances is garage clearances, an ideal service when you need to have a clear out and get rid of old, unwanted bits and pieces from small items up to old fridge-freezers, washing machines and more. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 72, 72, 'und', 0, 'Items that are big, bulky, and hard to move? Leave it to us. We are happy to move any item, so dont bother straining your back trying to do it yourself. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 73, 73, 'und', 0, 'Were happy to clear even small items and knick-knacks that may be creating a cluttered environment in your property. If you want to confirm with us if we will remove any specific items, please contact us to talk it through in more detail. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 74, 74, 'und', 0, 'Office clearances can involve moving large quantities of equipment often including some heavy, bulky items that can be difficult to move,that is where Lavender Clearances can help. We are extremely competent when it comes to large office clearances involving difficult to move items, old work stations, filing cabinets, desks & pedestals, chairs and paperwork or computer parts and anything else you can imagine. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 75, 75, 'und', 0, 'Commercial waste clearances are an important part of our business and as such we take it very seriously, making sure that we maintain an exceptionally high level of service in both our behaviour and our duties. So rest assured when we take on a new waste collection and waste removal job we are working to the highest possible standard. We make sure our waste clearance is completed with professional dedication and a great work ethic. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 76, 76, 'und', 0, 'If you''re looking for a full building site clearance service after completion of a job then look no further. Lavender Clearances can handle any size of building site clearance job and will leave your site looking spotless and in perfect condition to hand over to your client. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 77, 77, 'und', 0, 'Lavender clearances can arrange all aspects in regards to the probate valuation of deceased estates, for probate of contents. We can make a confusing and seemingly complex aspect of dealing with a bereavement a little easier.\r\nJust contact our office and we will be glad to take the strain and arrange the valuation.\r\nAlternatively please view our <a href="/probate-faq" title="Probate FAQ">Probate FAQ</a> page for more info. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 78, 78, 'und', 0, 'Items that are big, bulky, and hard to move? Leave it to us. We are happy to move any item, so dont bother straining your back trying to do it yourself. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'services', 0, 79, 79, 'und', 0, 'Were happy to clear even small items and knick-knacks that may be creating a cluttered environment in your property. If you want to confirm with us if we will remove any specific items, please contact us to talk it through in more detail. <strong>Prices start From 45.</strong>', '', 'full_html'),
('node', 'process', 0, 83, 83, 'und', 0, 'You find yourself with a property that needs to be emptied. You gather together all the personal items you want to keep - but what do you do with all the rest? What lies ahead of you is the possibly epic task of sorting through rooms and rooms of possessions, and to take multiple trips to charity shops or the dump to try and clear the property.', '', 'filtered_html'),
('node', 'process', 0, 84, 84, 'und', 0, 'We can do it ALL for you in one go. Contact us by phone, email, or by filling in our contact form, and tell us about tell us the nature of your clearance. We understand that sometimes the nature of the job may be due to a sensitive issue, such as the loss of a family member, and as professionals in our field we want to make the process of clearing the property as straightforward and easy as it can be for you.', '', 'filtered_html'),
('node', 'process', 0, 85, 85, 'und', 0, 'We''ll assess what needs to be done, and you choose a day convenient to you for the clearance. Our friendly team will arrive on the day, and in most cases by the end of the day your clearance will be completed. We''ll do all the hard work for you, and make sure wherever possible the items are either recycled or re-sold. Sit back and leave it to us!', '', 'filtered_html'),
('node', 'wp_blog', 0, 96, 96, 'und', 0, 'We received a phone call call from a very emotional lady at a property in Redhill, who had been let down by the clearance company who she had previously employed to clear her mothers 4 bedroom detached house. \r\n\r\nUpon arrival at the property for the viewing, it soon became apparent in our opinion that the previous company chosen to carry out the house clearance had bitten off more than they could chew! And had given the lady a completely unrealistic price and had promised to carry out the clearance on a specified date. On the date itself their team failed to appear and despite frantic phone calls were uncontactable. \r\n\r\nWe received at call at around 4.45 on the monday, went to view at 6 and after agreeing a realistic price arranged for our team to arrive at 8am the following morning. The property itself was large complete with garage, 4 sheds a stable and a basement which resembled a rabbit warren of little rooms all full of the occupants belongings collected over many years. \r\n\r\nThe basement itself took more time to clear than the rest of the house and outbuildings put together, complicated by the fact that it was no more than 4ft high throughout! So....4 packed vans later the job was completed by 6pm which was no mean feat and I think the team all enjoyed a relaxing bath to straighten their backs out!\r\n\r\nAnother satisfied customer who was relieved that the property was finally clear and a very stressful time was drawing to a close.', '', 'filtered_html'),
('node', 'wp_blog', 0, 97, 97, 'und', 0, 'No, dear reader this isn''t a book review but another example of one of the unusual requests the team at Lavender House Clearances receive." Wasps in October"? I hear you say but yes, they are very much alive and stingy even later into winter (this can depend upon the environment and other factors).\r\n\r\nOur client needed not only their house cleared but the garage too and of course the wasps... Armed with the safety gear and nest destroying chemicals (unfortunately this is the only viable solution to a wasp infestation) we approached the nest...\r\n\r\nThat''s really where the drama ends I''m almost sad to say. We applied the nest destroying chemicals, removed the nest from the garage, boxed it, bagged it and took it away along with any evidence of there being a wasp invasion at all leaving our client happy and un-stung!\r\n\r\nI guess the moral of the story is... We clear houses but we also clear nests...', '', 'filtered_html'),
('node', 'wp_blog', 0, 98, 98, 'und', 0, 'Many of the jobs we undertake here at Lavender Clearances are as a result of a bereavement. This can be a stressful and painful time for all involved. We will always be respectful, polite and adhere to the wishes of any of our clients so as to help make the whole process as easy as possible.', '', 'filtered_html'),
('node', 'wp_blog', 0, 99, 99, 'und', 0, 'Here at Lavender clearances we travel, a lot, in and around central London, Greater London, Sussex, Surrey, in fact the home counties and beyond in our ever expanding house clearing mission and we get to see some amazing parts of the country that even after having lived here all our lives you don''t always get the chance to see. I loved a job, clearing a bungalow on Box Hill soon after the Olympics, seeing the writing on the road the cycling fans had written for "Wiggo" in his quest for cycling gold to re-discovering how leafy North London after clearing a loft and driving home from clearing a beautiful Georgian house in what passes for traffic in Brighton! Happy days!\r\n\r\nOver it all I guess you forget how beautiful this country really is throughout the seasons.\r\n', '', 'filtered_html'),
('node', 'wp_blog', 0, 100, 100, 'und', 0, 'In a nutshell that''s what we do but sometimes it''s a little more...\r\n\r\nRe-cycling unwanted goods is so important today as we all know of dwindling resources and budgets!\r\n\r\nSo at Lavender House clearances we try and play our part. From our minimal landfill policy, donating to worthy causes, reselling items and only using waste recycling plants with the same commitment as us to helping the environment it may be only a small piece in the overall picture but if we all can do our bit then we can hopefully secure our future!', '', 'filtered_html'),
('node', 'wp_blog', 0, 101, 101, 'und', 0, 'People are different, very different, and that''s what makes us all unique. The same can be said for how and where we live.\r\n\r\nLast week we were called to clear a 4 bedroom house in a leafy suburb that had unfortunately been run down as the previous owner hadn''t been well before he sadly passed away.\r\n\r\nWe cleared the house which was jammed to the rafters with books, magazines, empty milk cartons and everything else that passes us by in our everyday life and in most cases is thrown away but, as is often the case for us, in this instance it had been kept.\r\n\r\nSo we were very happy to be able to find some much loved, and believed lost, personal items including jewellery and family photographs inside the house and reunite them with the family.\r\n\r\nBy no means is every house we clear a "show home" and circumstances can often be complicated by illness but after a very long and hard day it was great to leave the house totally cleared and with the knowledge that we''d made a small difference to the family in what is a difficult time. A job well done.\r\n\r\nLavender loves good Karma!', '', 'filtered_html'),
('node', 'testimonials', 0, 105, 105, 'und', 0, '"The men worked quickly, methodically and efficiently. Also very polite.', '', 'filtered_html'),
('node', 'testimonials', 0, 106, 106, 'und', 0, 'Excellent, polite, helpful and nothing too much bother.', '', 'filtered_html'),
('node', 'testimonials', 0, 107, 107, 'und', 0, 'Very quick, efficient and cleaned up after they had finished.', '', 'filtered_html'),
('node', 'testimonials', 0, 108, 108, 'und', 0, 'Fantastic! Would highly recommend.', '', 'filtered_html'),
('node', 'testimonials', 0, 109, 109, 'und', 0, 'Very efficient.', '', 'filtered_html'),
('node', 'testimonials', 0, 110, 110, 'und', 0, 'Fantastic service, would recommend to family and friends.', '', 'filtered_html'),
('node', 'testimonials', 0, 111, 111, 'und', 0, 'I would recommend this company.', '', 'filtered_html'),
('node', 'testimonials', 0, 112, 112, 'und', 0, 'Turned up on time, very courteous, got on with the job, worked very hard in difficult conditions.', '', 'filtered_html'),
('node', 'testimonials', 0, 113, 113, 'und', 0, '"Punctual, good team, work carried out well, no problems."', '', 'filtered_html'),
('node', 'page', 0, 115, 115, 'und', 0, 'We highly respect our customers'' privacy and we make sure that all personal/sensitive information provided by customers is help in accordance to the Data Protection Act 1998 and lawfully processed. Personal/sensitive information is any piece of information that may identify a living individual.\r\n\r\nWe DO NOT sell or share your personal information with third parties.\r\n\r\n<h3>What information do we collect</h3>\r\n\r\nWe collect some personal information from customers when sending an enquiry. The following data is collected:\r\n\r\nName\r\nEmail address\r\nTelephone\r\nPostcode\r\n\r\n<h3>How we use you information</h3>\r\n\r\nWe will only use supplied information for:\r\n\r\nProcess enquiries\r\nImprove our service standards\r\nSupply you with requested information\r\nIn accordance to our compliance with the Data Protection Act, we are happy to provide you any information we hold on you.\r\n\r\nIf you have any queries please contact us at:\r\n\r\nLavender Clearances Ltd \r\n16 Cheam Common Road \r\nWorcester Park \r\nSurrey\r\nKT4 8RW', '', 'filtered_html'),
('node', 'page', 0, 117, 117, 'und', 0, 'Looks like our website dropped something!\r\n<em>(Luckily we don''t when we''re clearing your property!)</em>\r\n\r\nPlease visit our <a href="http://www.lavenderclearances.com">Homepage</a> for more information about our clearance services.', '', 'filtered_html'),
('node', 'page', 0, 118, 118, 'und', 0, 'Lavender clearances can arrange all aspects in regards to the probate valuation of deceased estates, for probate of contents. We can make a be confusing and seemingly complex aspect of dealing with a bereavement a little easier.\r\nOur range of probate valuation services include;\r\n<dl>\r\n<dt>Household Contents</dt>\r\n<dd>Detailed valuation of furniture, electrical goods, soft furnishings and general household effects</dd>\r\n<dt>Antiques & Fine Art</dt>\r\n<dd>Accurate valuation of antiques and fine art with an individual value of 500 and upwards</dd>\r\n<dt>Books & Ephemera</dt>\r\n<dd>Specialist valuation of book collections, 1st editions, antiquarian, ephemera and autographs</dd>\r\n<dt>Motorcar Valuation</dt>\r\n<dd>The valuation of motor vehicles</dd>\r\n</dl>\r\n<h3>Probate Valuation Service FAQs</h3>\r\n<dl>\r\n<dt>What is a probate valuation?</dt>\r\n<dd>Basically, the purpose of the valuation is to ascertain the value of the assets held in the estate. There are many reasons why this is important. In the first instance, a probate valuation will be required to show whether or not Inheritance Tax (IHT) is due on the estate and, if so, how much will be charged. This is a vital step in the procedure, as it will directly impact the eventual sums to be passed on to the beneficiaries. Also, according to probate law executors are likely to find that their powers of administration are limited until a percentage of any IHT owing has been paid. As such, it is important that probate valuation occurs quickly in order to ensure that the rest of the probate process can continue.</dd>\r\n<dt>Do I need a Solicitor?</dt>\r\n<dd>No. Personal applications are accepted by the Probate Registry, if a deceased persons tax affairs are complicated then the use of a solicitor is recommended.</dd>\r\n<dt>How much do you charge for Probate Valuation?</dt>\r\n<dd>We do have a set price which may obviously change under different circumstances ; cluttered properties or unusual or rare items that require detailed research.</dd>\r\n<dt>Why do I need a probate valuation?</dt>\r\n<dd>A probate valuation by someone without expert knowledge could result in over valuation, which could cause additional, unnecessary tax liabilities or undervaluation, resulting in a query being raised by the tax authorities, which could cause significant delays in the winding up of the estate.</dd>\r\n<dt>Can a probate valuation report be rejected by HMRC?</dt>\r\n<dd>Yes. There are a number of inexperienced companies that are being queried by HM Revenue and Customs for inaccurate valuations, if this is the case probate valuations will be rejected causing unnecessary delays and additional expenses to executors.</dd>\r\n</dl>\r\n<h4>Which HMRC forms will I need when dealing with probate valuation of household and personal goods or chattels?</h4>\r\nYou will need to complete the following forms:\r\n<ul>\r\n<li>Schedule IHT 407  For jewellery, vehicles, boats, aircraft, antiques, works of art, or collections</li>\r\n<li>Schedule IHT 408  This is for household and personal goods donated to charity.</li>\r\n<li>Schedule IHT 404  Jointly owned assets.</li>\r\n</ul>\r\nThe forms are available online and can be downloaded from www.hmrc.gov.uk/inheritancetax/. Attach your written probate valuation to these forms when submitting them to HMRC.\r\nThe contents of the property have no commercial value, so why do I need to get a professional written probate valuation?\r\nEven in this case it is advisable to get an accurate valuation, as the Inland Revenue usually requires this, , it can also help to speed up the winding up of the estate.\r\n<dl>\r\n<dt>Can you undertake a probate valuation in a cluttered property?</dt>\r\n<dd>Yes. We can arrange a probate valuation in almost any conditions.</dd>\r\n<dt>How is a probate valuation different to an insurance valuation?</dt>\r\n<dd>A probate valuation is the mid-range value expected of the estimated value, but an insurance valuation will be the full value of replacement items, which will generally be higher..</dd>\r\n</dl>\r\n<h5>Helpful links</h5>\r\nHow to value the estate of someone who has died - the basics\r\nhttp://search2.hmrc.gov.uk/kb5/hmrc/contactus/view.page?record=Ve4W32E6kds\r\nContact the Probate and Inheritance Tax Helpline', '', 'full_html'),
