(2, 'node', ' free no obligation quote we are here to help 247 whenever you need our services simply call us email us or fill out the form below to solve all your clearance problems there is absolutely no obligation and we think you will be pleasantly surprised with our prices we look forward to hearing from you your name company name if applicable phone number email address post code upload a pic upload captcha please answer the questions below so we know you re not a robot many thanks math question 7 12 submit  ', 0),
(5, 'node', ' property clearance service in london surrey and the south of england 10 years experience in property clearance we are london and the south east s leading property clearance company we specialise in house clearance we remove everything from furniture and white goods such as washing machines and cookers to carpets and soft furnishings we also provide loft and garage clearances and garden clearance items can be cleared and delivered to an alternative address stored or disposed of we take time wherever possible to recycle any items we may find including clothes books and paperwork domestic clearances commercial clearance we also provide a range of commercial clearance services including waste removal and disposal and office clearance we can clear unwanted junk clutter and rubbish as and when requested our office clearance in london surrey and the home counties includes removal and disposal of office furniture filing cabinets and paperwork electrical appliances and computer parts in london surrey and the home counties we clear everything including carpets scrap metal heavy machinery junk and verminous rubbish commercial clearances ', 0),
(16, 'node', ' garden clearance we can clear garden waste from gardens of all sizes  ', 0),
(17, 'node', ' reuse items that can be reused are taken to businesses and charities to be used as secondhand goods  ', 0),
