(62, 'node', ' about lavender clearances lavender clearances are an experienced team of hardworking professionals who have been in the business for many years and understand the importance of high quality customer services and getting the job done right first time every time we carry out all clearance work with professional diligence and the minimum of fuss  ', 0),
(69, 'node', ' house clearance clearing a house can be a a big task which can be time consuming complex and very physically demanding circumstances aren t always pleasant either if it involves illness or bereavement at lavender clearances our aim is to make the process as quick and easy as possible we are happy to undertake any house clearance task big or small if it is the entire contents of a property or even just a couple of items we will carry out the work efficiently and with professional diligence prices start from 45  45 residential ', 0),
(70, 'node', ' garden clearance we don t just clear buildings our services also extend to your gardens no matter the size so if you ve been carrying out work in your garden and have been left with more garden waste than you can comfortably handle yourself then give us a call and we will get to work clearing your garden waste regardless of the size we will carry out garden clearances with professional diligence and the minimum of fuss prices start from 45  45 residential ', 0),
(71, 'node', ' garage clearance one of our many services at lavender clearances is garage clearances an ideal service when you need to have a clear out and get rid of old unwanted bits and pieces from small items up to old fridgefreezers washing machines and more prices start from 45  45 residential ', 0),
(72, 'node', ' big and heavy items items that are big bulky and hard to move leave it to us we are happy to move any item so don t bother straining your back trying to do it yourself prices start from 45  45 residential ', 0),
(73, 'node', ' small items we re happy to clear even small items and knickknacks that may be creating a cluttered environment in your property if you want to confirm with us if we will remove any specific items please contact us to talk it through in more detail prices start from 45  45 residential ', 0),
(74, 'node', ' office clearance office clearances can involve moving large quantities of equipment often including some heavy bulky items that can be difficult to move that is where lavender clearances can help we are extremely competent when it comes to large office clearances involving difficult to move items old work stations filing cabinets desks pedestals chairs and paperwork or computer parts and anything else you can imagine prices start from 45  45 commercial ', 0),
(75, 'node', ' trade clearance commercial waste clearances are an important part of our business and as such we take it very seriously making sure that we maintain an exceptionally high level of service in both our behaviour and our duties so rest assured when we take on a new waste collection and waste removal job we are working to the highest possible standard we make sure our waste clearance is completed with professional dedication and a great work ethic prices start from 45  45 commercial ', 0),
(76, 'node', ' construction clearance if you re looking for a full building site clearance service after completion of a job then look no further lavender clearances can handle any size of building site clearance job and will leave your site looking spotless and in perfect condition to hand over to your client prices start from 45  45 commercial ', 0),
(77, 'node', ' probate valuation service lavender clearances can arrange all aspects in regards to the probate valuation of deceased estates for probate of contents we can make a confusing and seemingly complex aspect of dealing with a bereavement a little easier just contact our office and we will be glad to take the strain and arrange the valuation alternatively please view our probate faq page for more info prices start from 45  45 residential ', 0),
