(83, 'node', ' need a hand  you find yourself with a property that needs to be emptied you gather together all the personal items you want to keep but what do you do with all the rest what lies ahead of you is the possibly epic task of sorting through rooms and rooms of possessions and to take multiple trips to charity shops or the dump to try and clear the property  ', 0),
(84, 'node', ' get in touch with us we can do it all for you in one go contact us by phone email or by filling in our contact form and tell us about tell us the nature of your clearance we understand that sometimes the nature of the job may be due to a sensitive issue such as the loss of a family member and as professionals in our field we want to make the process of clearing the property as straightforward and easy as it can be for you  ', 0),
(85, 'node', ' let s get started we ll assess what needs to be done and you choose a day convenient to you for the clearance our friendly team will arrive on the day and in most cases by the end of the day your clearance will be completed we ll do all the hard work for you and make sure wherever possible the items are either recycled or resold sit back and leave it to us  ', 0),
