(96, 'node', ' every cloud redhill surrey we received a phone call call from a very emotional lady at a property in redhill who had been let down by the clearance company who she had previously employed to clear her mothers 4 bedroom detached house upon arrival at the property for the viewing it soon became apparent in our opinion that the previous company chosen to carry out the house clearance had bitten off more than they could chew and had given the lady a completely unrealistic price and had promised to carry out the clearance on a specified date on the date itself their team failed to appear and despite frantic phone calls were uncontactable we received at call at around 445 on the monday went to view at 6 and after agreeing a realistic price arranged for our team to arrive at 8am the following morning the property itself was large complete with garage 4 sheds a stable and a basement which resembled a rabbit warren of little rooms all full of the occupants belongings collected over many years the basement itself took more time to clear than the rest of the house and outbuildings put together complicated by the fact that it was no more than 4ft high throughout so 4 packed vans later the job was completed by 6pm which was no mean feat and i think the team all enjoyed a relaxing bath to straighten their backs out another satisfied customer who was relieved that the property was finally clear and a very stressful time was drawing to a close  ', 0),
(97, 'node', ' the wasp factory no dear reader this isn t a book review but another example of one of the unusual requests the team at lavender house clearances receive wasps in october i hear you say but yes they are very much alive and stingy even later into winter this can depend upon the environment and other factors our client needed not only their house cleared but the garage too and of course the wasps armed with the safety gear and nest destroying chemicals unfortunately this is the only viable solution to a wasp infestation we approached the nest that s really where the drama ends i m almost sad to say we applied the nest destroying chemicals removed the nest from the garage boxed it bagged it and took it away along with any evidence of there being a wasp invasion at all leaving our client happy and unstung i guess the moral of the story is we clear houses but we also clear nests  ', 0),
(98, 'node', ' sensitive times many of the jobs we undertake here at lavender clearances are as a result of a bereavement this can be a stressful and painful time for all involved we will always be respectful polite and adhere to the wishes of any of our clients so as to help make the whole process as easy as possible  ', 0),
(99, 'node', ' on the road here at lavender clearances we travel a lot in and around central london greater london sussex surrey in fact the home counties and beyond in our ever expanding house clearing mission and we get to see some amazing parts of the country that even after having lived here all our lives you don t always get the chance to see i loved a job clearing a bungalow on box hill soon after the olympics seeing the writing on the road the cycling fans had written for wiggo in his quest for cycling gold to rediscovering how leafy north london after clearing a loft and driving home from clearing a beautiful georgian house in what passes for traffic in brighton happy days over it all i guess you forget how beautiful this country really is throughout the seasons  ', 0),
(100, 'node', ' oneratis et expositura load and unload in a nutshell that s what we do but sometimes it s a little more recycling unwanted goods is so important today as we all know of dwindling resources and budgets so at lavender house clearances we try and play our part from our minimal landfill policy donating to worthy causes reselling items and only using waste recycling plants with the same commitment as us to helping the environment it may be only a small piece in the overall picture but if we all can do our bit then we can hopefully secure our future  ', 0),
(101, 'node', ' every cloud people are different very different and that s what makes us all unique the same can be said for how and where we live last week we were called to clear a 4 bedroom house in a leafy suburb that had unfortunately been run down as the previous owner hadn t been well before he sadly passed away we cleared the house which was jammed to the rafters with books magazines empty milk cartons and everything else that passes us by in our everyday life and in most cases is thrown away but as is often the case for us in this instance it had been kept so we were very happy to be able to find some much loved and believed lost personal items including jewellery and family photographs inside the house and reunite them with the family by no means is every house we clear a show home and circumstances can often be complicated by illness but after a very long and hard day it was great to leave the house totally cleared and with the knowledge that we d made a small difference to the family in what is a difficult time a job well done lavender loves good karma  residential heavy items ', 0),
(105, 'node', ' richard brown in east grinstead  the men worked quickly methodically and efficiently also very polite 10  ', 0),
(106, 'node', ' graeme peters in epsom  excellent polite helpful and nothing too much bother 10  ', 0),
(107, 'node', ' patrick shalford in watford  very quick efficient and cleaned up after they had finished 10  ', 0),
(108, 'node', ' anita clarence in salisbury  fantastic would highly recommend 10  ', 0),
(109, 'node', ' lucia polizzi in london  very efficient 10  ', 0),
(110, 'node', ' amir patel in worcester park  fantastic service would recommend to family and friends 10  ', 0),
(111, 'node', ' denzil tanner in milton keynes  i would recommend this company 97  ', 0),
(112, 'node', ' sarah ellischase in ashford  turned up on time very courteous got on with the job worked very hard in difficult conditions 95  ', 0),
(113, 'node', ' john ashley in camberley  punctual good team work carried out well no problems 98  ', 0),
(115, 'node', ' privacy policy we highly respect our customers privacy and we make sure that all personal sensitive information provided by customers is help in accordance to the data protection act 1998 and lawfully processed personal sensitive information is any piece of information that may identify a living individual we do not sell or share your personal information with third parties what information do we collect we collect some personal information from customers when sending an enquiry the following data is collected name email address telephone postcode how we use you information we will only use supplied information for process enquiries improve our service standards supply you with requested information in accordance to our compliance with the data protection act we are happy to provide you any information we hold on you if you have any queries please contact us at lavender clearances ltd 16 cheam common road worcester park surrey kt4 8rw  ', 0),
(117, 'node', ' whoops  looks like our website dropped something   luckily we don t when we re clearing your property  please visit our homepage for more information about our clearance services  ', 0),
(118, 'node', ' probate valuation service faq lavender clearances can arrange all aspects in regards to the probate valuation of deceased estate s for probate of contents we can make a be confusing and seemingly complex aspect of dealing with a bereavement a little easier our range of probate valuation services include household contents detailed valuation of furniture electrical goods soft furnishings and general household effects antiques fine art accurate valuation of antiques and fine art with an individual value of 500 and upwards books ephemera specialist valuation of book collections 1st editions antiquarian ephemera and autographs motorcar valuation the valuation of motor vehicles probate valuation service faqs what is a probate valuation basically the purpose of the valuation is to ascertain the value of the assets held in the estate there are many reasons why this is important in the first instance a probate valuation will be required to show whether or not inheritance tax iht is due on the estate and if so how much will be charged this is a vital step in the procedure as it will directly impact the eventual sums to be passed on to the beneficiaries also according to probate law executors are likely to find that their powers of administration are limited until a percentage of any iht owing has been paid as such it is important that probate valuation occurs quickly in order to ensure that the rest of the probate process can continue do i need a solicitor no personal applications are accepted by the probate registry if a deceased persons tax affairs are complicated then the use of a solicitor is recommended how much do you charge for probate valuation we do have a set price which may obviously change under different circumstances cluttered properties or unusual or rare items that require detailed research why do i need a probate valuation a probate valuation by someone without expert knowledge could result in over valuation which could cause additional unnecessary tax liabilities or undervaluation resulting in a query being raised by the tax authorities which could cause significant delays in the winding up of the estate can a probate valuation report be rejected by hmrc yes there are a number of inexperienced companies that are being queried by hm revenue and customs for inaccurate valuations if this is the case probate valuations will be rejected causing unnecessary delays and additional expenses to executors which hmrc forms will i need when dealing with probate valuation of household and personal goods or chattels  you will need to complete the following forms schedule iht 407 for jewellery vehicles boats aircraft antiques works of art or collections schedule iht 408 this is for household and personal goods donated to charity schedule iht 404 jointly owned assets the forms are available online and can be downloaded from wwwhmrcgovuk inheritancetax   attach your written probate valuation to these forms when submitting them to hmrc the contents of the property have no commercial value so why do i need to get a professional written probate valuation even in this case it is advisable to get an accurate valuation as the inland revenue usually requires this it can also help to speed up the winding up of the estate can you undertake a probate valuation in a cluttered property yes we can arrange a probate valuation in almost any conditions how is a probate valuation different to an insurance valuation a probate valuation is the midrange value expected of the estimated value but an insurance valuation will be the full value of replacement items which will generally be higher  helpful links how to value the estate of someone who has died the basics http search2hmrcgovuk kb5 hmrc contactus viewpage record ve4w32e6kds contact the probate and inheritance tax helpline  probate faq  ', 0),
